import React, { Component } from 'react';

class Profile extends Component {
    constructor(props){
        super(props);
    }
    render() {
        const {id,array}=this.props;
        if (array) {
          const words = array.map(function(word,index){
            return (
            <div>
                <p className='f3 fw6 link dim pa3 pointer white'>Welcome {id}</p>
                <br/>
                <p className='f3 fw6 link dim pa3 pointer white'>Here is the vocabulary you need to review</p>
                <br/>
                <div className='fl w-30 pa2 boarder-box'>
                <div className='col-lg-4' key={index}>
                    <p className='f3 fw6 link dim pa3 pointer white'>
                        {word}
                    </p>
                </div>
                </div>
            </div>
            )
          })  
          return <div>{words}</div>
        }
        return <div>You don't have anything in vocabulary yet</div>
      }

}

export default Profile;
